import React from "react";
import Progress from "progress";
function Bottom(props){
    
    return (
    <div>
       <h4>Accuracy</h4>
        <Progress/>
        <h4>Words per minute(WPM) : (props.wpm}</h4>
    </div>
    );
}
export default Bottom;
